import React from "react";
import '../../src/css/Navbar.css';


const Navbar = () => {
    return (
      <div className="navbar">
        <div className="navbar-item">ABOUT</div>
        <div className="navbar-item">MUSIC</div>
        <div className="navbar-item">SHOP</div>
      </div>
    );
  };
  
  export default Navbar;
